#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAX(a,b) (a>b?a:b)
#define HASHSIZE 100



int lengthOfLongestSubstring(char *s)
{
  char *a1=s;
  int start=0, max = 0, end = 0;
  int hashTable[HASHSIZE];
  memset(hashTable,-1,sizeof(hashTable));
  for(;*a1;a1++,end++){
    if(hashTable[*a1 % HASHSIZE] >= start){
      max = MAX(max, (end-start));
      start = hashTable[*a1 % HASHSIZE] + 1;
    }
    hashTable[*a1 % HASHSIZE] = end;
  }
  max = MAX(max, (end-start));
  return max;

}


